import React, { Component } from 'react';
import logo_Wnoback2 from '../IMG/logo_Wnoback2.png';
import './Header.css';


class Videos extends Component {
    constructor() {
        super();
        this.state = {
            videos: [
                {
                    id: 1,
                    src: ""
                },
                {
                    id: 2,
                    src: ""
                },

            ]
        };
    }


    render() {
        return (
            <div>
                {this.state.videos.map((data, i) => {
                    return (
                        <div>
                            <p key={i}>{data.id} </p>
                            <p key={i}>{data.src} </p>
                        </div>
                    )
                })}
            </div>
        );
    }
}

export default Videos
